import React, { useState } from 'react'
import {UseState} from 'react'
import { Link } from 'react-router-dom'
export default function Register() {
  const [details,setdetails]=useState([]);
  const [detail,setdetail]=useState({});
  const handleSubmit=()=>{
    setdetails([...details,detail]);
  }
  return (
    <div className='App-Row'>
      <h2>Registration Form</h2>
      <p><input type="text" placeholder='Enter name' onChange={(e)=>setdetail({...detail,name: e.target.value})}></input></p>
      <p><input type="text" placeholder='Email address' onChange={(e)=>setdetail({...detail,email: e.target.value})}></input></p>
      <p><input type="password" placeholder='New password' onChange={(e)=>setdetail({...detail,password: e.target.value})}></input></p>
      <p><button onClick={handleSubmit}>Submit</button></p>
      <h4>items</h4>
      <table border={1}>
        {details &&detail.map((value,indec)=><tr>
          <td>{value.name}</td>
          <td>{value.email}</td>
          <td>{value.password}</td>
        </tr>)}
      </table>
      <p>
        <Link to="../login">Already a member? Log In</Link>
      </p>
    </div>
  )
};
